import React, { useState, useEffect } from "react";

const App = () => {
  const [movie, setMovie] = useState({});

  useEffect(async => {
    const data = axios(
      "https://api.themoviedb.org/3/search/movie?api_key=fac34116c639f3e75cd5205251be421c&query=search"
    );

    setMovie(data.movie);
  }, []);

  return <h1>{}</h1>;
};

export default App;
